import React from "react";
import background from "../Assets/IMG/volvote.jpg";
import {
  FormAutoComponent,
  FormUsuarioComponent,
  TableAutoComponent,
  TableUsuarioComponent,
  ButtonComponents,
} from "../components";

const HomePage = () => {
  return (
    // <div style={
    //     { backgroundImage: `url(${background})` };
    //     { background-repeat: `no-repeat`        };
    //     }>
    <div>
      <img
        src={background}
        alt="aaa"
        style={{
          position: "absolute",
          zIndex: -1,
          width: "100%",
          height: "200%",
        }}
      />

      <FormAutoComponent />
      <br />
      <FormUsuarioComponent />
      <br />
      <TableAutoComponent />
      <ButtonComponents />
      <br />
      <TableUsuarioComponent />
      <ButtonComponents />
      <br />
    </div>
  );
};
export default HomePage;
